-- Drop table

-- DROP TABLE "orders";

CREATE TABLE "statuses"(
	status_id serial4 NOT NULL,
	title varchar(50) NOT NULL,
	CONSTRAINT statuses_pk PRIMARY KEY (status_id)
);

